(1, 'img/asesorias/asesorias.jpg', 'Silenciando tu mente', 'Imagínese deslizándose hacia un estado de meditación feliz con solo presionar un botón.', 70, NULL, 'Nos veremos por una hora y media aproximadamente, (1 VEZ), donde te enseñaré todo lo que necesitas saber para llevar a cabo el método de manera segura, confiable, tranquila  y correcta.  \nNos veremos por la APP que te sea más fácil , Zoom , FaceTimeo O WhatsApp . La idea es estar online en un ambiente cómodo.', NULL, 'activo', NULL, NULL, NULL),
(2, 'img/asesorias/asesorias.jpg', 'Silenciando tu mente 2', 'Imagínese deslizándose hacia un estado de meditación feliz con solo presionar un botón.', 90, NULL, 'Nos veremos por una hora y media aproximadamente, (1 VEZ), donde te enseñaré todo lo que necesitas saber para llevar a cabo el método de manera segura, confiable, tranquila  y correcta.  \r\nNos veremos por la APP que te sea más fácil , Zoom , FaceTimeo O WhatsApp . La idea es estar online en un ambiente cómodo.', NULL, 'activo', NULL, NULL, NULL);
